import React, { useEffect, useState } from "react";
import heatmap from "heatmap.js"; // Import heatmap.js for heatmap rendering
import moment from "moment"; // For formatting timestamps

const API_URL = "http://localhost:8080/api/data"; // API endpoint

const HeatmapComponent = () => {
  const [startTime, setStartTime] = useState(null);
  const [endTime, setEndTime] = useState(null);

  // Fetch heatmap data on component mount
  useEffect(() => {
    fetch(`${API_URL}/heatmap`)
      .then((res) => res.json())
      .then((data) => {
        console.log("Fetched heatmap data:", data); // Log data for debugging

        // Set start and end times based on first and last data points
        if (data.length > 0) {
          setStartTime(data[0].timestamp); // First timestamp
          setEndTime(data[data.length - 1].timestamp); // Last timestamp
        }

        // Create heatmap after data is fetched
        createHeatmap(data);
      })
      .catch((error) => {
        console.error("Error fetching heatmap data:", error);
      });
  }, []);

  // Format timestamp to a human-readable format using moment.js
  const formatTimestamp = (timestamp) => {
    return moment(timestamp).format("YYYY-MM-DD HH:mm:ss"); // Customize format if needed
  };

  // Function to create the heatmap using heatmap.js
  const createHeatmap = (data) => {
    // Get the dimensions of the heatmap container
    const container = document.getElementById("heatmapContainer");
    const containerWidth = container.offsetWidth;
    const containerHeight = container.offsetHeight;

    // Find the maximum x and y values in the data
    const maxX = Math.max(...data.map((point) => point.posX));
    const maxY = Math.max(...data.map((point) => point.posY));

    // Prepare data for heatmap.js
    const points = data.map((point) => ({
      x: Math.floor((point.posX / maxX) * containerWidth), // Scale x to fit container width
      y: Math.floor((point.posY / maxY) * containerHeight), // Scale y to fit container height
      value: point.intensity, // Use intensity from DTO
    }));

    console.log("Formatted points for heatmap:", points); // Check the points array

    // Initialize the heatmap instance
    const heatmapInstance = heatmap.create({
      container: container, // The container where the heatmap will be drawn
      radius: 30, // Adjust radius as needed
      maxOpacity: 0.5, // Maximum opacity of the heatmap
      minOpacity: 0, // Minimum opacity of the heatmap
      blur: 0.85, // Blur factor for the heatmap
    });

    console.log("Heatmap instance created:", heatmapInstance); // Log the instance

    // Set the heatmap data
    heatmapInstance.setData({
      max: Math.max(...points.map((p) => p.value)), // Maximum intensity value
      data: points, // Array of data points
    });

    // Add x and y axes with 6 divisions
    addAxes(containerWidth, containerHeight, maxX, maxY);
  };

  // Function to add x and y axes with 6 divisions
  const addAxes = (width, height, maxX, maxY) => {
    const container = document.getElementById("heatmapContainer");

    // Create x-axis
    const xAxis = document.createElement("div");
    xAxis.style.position = "absolute";
    xAxis.style.bottom = "0";
    xAxis.style.left = "0";
    xAxis.style.width = "100%";
    xAxis.style.height = "20px";
    xAxis.style.borderTop = "1px solid black";
    xAxis.style.display = "flex";
    xAxis.style.justifyContent = "space-between";
    xAxis.style.alignItems = "center";
    xAxis.style.padding = "0 10px";

    // Add x-axis labels (6 divisions)
    const xLabels = Array.from({ length: 6 }, (_, i) => ((maxX / 5) * i).toFixed(2)); // 6 divisions
    xLabels.forEach((label) => {
      const labelElement = document.createElement("span");
      labelElement.innerText = label;
      xAxis.appendChild(labelElement);
    });

    container.appendChild(xAxis);

    // Create y-axis
    const yAxis = document.createElement("div");
    yAxis.style.position = "absolute";
    yAxis.style.top = "0";
    yAxis.style.left = "0";
    yAxis.style.width = "20px";
    yAxis.style.height = "100%";
    yAxis.style.borderRight = "1px solid black";
    yAxis.style.display = "flex";
    yAxis.style.flexDirection = "column";
    yAxis.style.justifyContent = "space-between";
    yAxis.style.alignItems = "center";
    yAxis.style.padding = "10px 0";

    // Add y-axis labels (6 divisions)
    const yLabels = Array.from({ length: 6 }, (_, i) => ((maxY / 5) * i).toFixed(2)); // 6 divisions
    yLabels.forEach((label) => {
      const labelElement = document.createElement("span");
      labelElement.innerText = label;
      yAxis.appendChild(labelElement);
    });

    container.appendChild(yAxis);
  };

  return (
    <div>
      <h3>Positional Heatmap</h3>
      {/* Heatmap container */}
      <div
        id="heatmapContainer"
        style={{
          width: "100%",
          height: "500px",
          position: "relative",
        }}
      ></div>

      {/* Displaying start and end time */}
      <div>
        <h4>Start Time: {startTime ? formatTimestamp(startTime) : "Loading..."}</h4>
        <h4>End Time: {endTime ? formatTimestamp(endTime) : "Loading..."}</h4>
      </div>
    </div>
  );
};

export default HeatmapComponent;
